import React from 'react';//importa o reac para o arquivo

import logoImg from '../../assets/logo.svg';//importa logo da pagina de login


export default function profile(){
    return(
        <div class="profile-container">
            <header>
                <img src={logoImg} alt="Be The Hero" />
            </header>
        </div>
    );
}
